import './AddRecipe.css';
import { useState } from 'react';

function AddRecipe() {

    const [title, setTitle] = useState("");
    const [s, setS] = useState("");
    const [text, setText] = useState("");
    const [author, setAuthor] = useState("");

    function recipeAdd(name) {
        alert("Hello World " + name);
    }

    return(
        <main className="mainSection">
            <article className="mainArticle">
                <h1>Add new recipe</h1>
                <form id="addRecipeForm" onSubmit ={ () => { recipeAdd("Dusan") } }>
                    <input type="text" id="title" placeholder="Enter title" onChange={ (e) => setTitle(e.target.value) }></input><br />
                    <input type="text" id="s" placeholder="Enter s" onChange={ (e) => setS(e.target.value) }></input><br />
                    <input type="text" id="text" placeholder="Enter text" onChange={ (e) => setText(e.target.value) }></input><br />
                    <input type="text" id="author" placeholder="Enter author" onChange={ (e) => setAuthor(e.target.value) }></input><br />
                    <button>Add</button>
                </form>
            </article>
        </main> 
    );
};

export default AddRecipe;
